export class DataParser{
    constructor(data){
        this.inputData = data
    }

    Parse(){
        let outputData = {"nodes":[], "links": []}
        
        //Запись связей
        this.inputData.links.map(elem=>{
            outputData.links.push(elem)
        })
        // outputData.links.push(this.inputData.links)

        console.log(outputData)
    }
}
